function App() {
  return (
    <div className="bg-bg-img overflow-hidden h-screen w-screen bg-cover md:bg-contain">
      <div className="bg-black h-full bg-opacity-25">
        <Header />
        <div className="h-full w-full items-center flex justify-center">
          <div className="text-center">
            <h1 className="font-bold">Blogs</h1>
            <p className="">
              "Information is a source of learning. But unless it is organized, processed, and available to the right people in a format for decision making, it is a burden, not a benefit." ~ William Pollard
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
